import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Route,Link,Switch} from 'react-router-dom'

import DesignTime from './js/Pages/Designer';
import RunTime from './js/Pages/RunTime';



function App() {
  return (
    <>
      <Link to = "/design"><button id="design"> Design</button></Link>
      <Link to = "/interact"><button id="interact"> Design</button></Link>
      <BrowserRouter>
        <div className="App">
          <Switch>
            <Route path='/design'><DesignTime /></Route>
            <Route path='/interact'><RunTime /></Route>
          </Switch>
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
